INSERT INTO `wp_posts` VALUES (1,1,'2015-04-27 06:32:20','2015-04-27 06:32:20','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2015-04-27 06:32:20','2015-04-27 06:32:20','',0,'http://herithelp.local:8888/?p=1',0,'post','',1),(2,1,'2015-04-27 06:32:20','2015-04-27 06:32:20','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://herithelp.local:8888/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2015-04-27 06:32:20','2015-04-27 06:32:20','',0,'http://herithelp.local:8888/?page_id=2',0,'page','',0),(3,1,'2015-04-27 06:32:45','2015-04-27 06:32:45','<p>Your Name (required)<br />\n    [text* your-name] </p>\n\n<p>Your Email (required)<br />\n    [email* your-email] </p>\n\n<p>Subject<br />\n    [text your-subject] </p>\n\n<p>Your Message<br />\n    [textarea your-message] </p>\n\n<p>[submit \"Send\"]</p>\n[your-subject]\n[your-name] <wordpress@herithelp.local>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on herithelp (http://herithelp.local:8888)\nwebadmin@polyptychon.gr\nReply-To: [your-email]\n\n0\n0\n\n[your-subject]\nherithelp <wordpress@herithelp.local>\nMessage Body:\n[your-message]\n\n--\nThis e-mail was sent from a contact form on herithelp (http://herithelp.local:8888)\n[your-email]\nReply-To: webadmin@polyptychon.gr\n\n0\n0\nYour message was sent successfully. Thanks.\nFailed to send your message. Please try later or contact the administrator by another method.\nValidation errors occurred. Please confirm the fields and submit it again.\nFailed to send your message. Please try later or contact the administrator by another method.\nPlease accept the terms to proceed.\nPlease fill in the required field.\nThis input is too long.\nThis input is too short.','Contact form 1','','publish','open','open','','contact-form-1','','','2015-04-27 06:32:45','2015-04-27 06:32:45','',0,'http://herithelp.local:8888/?post_type=wpcf7_contact_form&p=3',0,'wpcf7_contact_form','',0);
